import React, {useEffect, useState} from 'react';
import {useNavigate, useParams} from "react-router-dom";
import {checkSurvey} from "../../utils/checkSurvey";


// 检查 surveyId 是否合法
const CheckSurvey = () => {
	const {surveyId} = useParams();
	const navigate = useNavigate();
	const [checkResult, setCheckResult] = useState({
		isValid: false, // 问卷是否有效
		surveyData: null, // 问卷详情, title, description, questions, endCollection, userId
		error: null // 无效原因 code, message
	});
	const currentUser = localStorage.getItem('token');

	// 检查 surveyId 是否合法
	useEffect(() => {
		if (surveyId) {
			checkSurvey(surveyId).then(r => console.log(r))
		}
	}, [surveyId])


	return (
		<div>
			{'让我大调查一下你的 surveyId 合不合法...'}
			{checkResult.isValid ? <div>{'合法合法'}</div> : <div>{'不合法'}</div>}
		</div>
	);
};

export default CheckSurvey;
